(141, 'MEDIGITAL 1.0 Building tech-informed medics for futuristic effective healthcare service delivery', 'EVT_16318196486066', '<p>The 2-day virtual training is a collaboration between NiMSA SouthWest region and McKODEV TECH LAB, designed to increase the knowledge and skill of students across various medical students association (MSAs) in the South West region of NiMSA, in basic software applications for effective healthcare service delivery.</p><p>This highlights the interest of the Regional Executive Council, in the application of technology to improve universal access to healthcare information and services, as well as brings awareness to the incredible work McKODEV TECH LAB does in providing custom software development services as a solution to individual and large-scale tech needs.</p><p>We look forward to engaging with you.</p>', '2021-09-25', '2021-09-26', 'uploads/16318196486936180WhatsApp_Image_2021_09_16_at_8.06.17_PM.jpeg', '1631604766_9274848', '07:14:08', '2021-09-16', 'thumb/16318196483811712WhatsApp_Image_2021_09_16_at_8.06.17_PM.jpeg', 0, '11am', NULL, 'NiMSA South West Region', '<p>dfgggggg</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2021-09-25', NULL, 41, NULL, NULL, 'mdeigital1.0', NULL, '231rcfre2', 146, NULL, 'free', NULL, NULL, NULL, 'Zoom', 'a:6:{s:64:\"RnVsbCBuYW1lIChhcyBpdCBzaG91bGQgYXBwZWFyIG9uIGNlcnRpZmljYXRlKQ==\";a:5:{s:2:\"id\";s:64:\"RnVsbCBuYW1lIChhcyBpdCBzaG91bGQgYXBwZWFyIG9uIGNlcnRpZmljYXRlKQ==\";s:8:\"question\";s:46:\"Full name (as it should appear on certificate)\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:4:\"TVNB\";a:5:{s:2:\"id\";s:4:\"TVNB\";s:8:\"question\";s:3:\"MSA\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:8:\"TGV2ZWw=\";a:5:{s:2:\"id\";s:8:\"TGV2ZWw=\";s:8:\"question\";s:5:\"Level\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:20:\"V2hhdHNBcHAgTnVtYmVy\";a:5:{s:2:\"id\";s:20:\"V2hhdHNBcHAgTnVtYmVy\";s:8:\