(150, 'S A F E Summit 2.0', 'EVT_16361793205373', '<p>The Raise a Famer Initiativeâ€™s (RAFI) SAFE summit is a one day panelist session that has been setup primarily to lead conversations in a bid to achieve standardization in Production, Pricing, and Supply in the Vegetablesâ€™ Value Chain.<br>The RAFIâ€™s SAFE summit will welcome active stake holders from different business categories and spaces to drive conversations; ask questions and draw out consensual conclusions around standardization in Production, Pricing, and measurement in the value chain of vegetables. The panelist will comprise of;<br>1. Market linkage Experts<br>2. Government and Policy makers</p><p>3. International NGOs focused on agriculture 4. Consumers<br>5. Famers and<br>6. Input providers.<br>The Raise a Famer Initiativeâ€™s (RAFI) SAFE summit is schedule to take place on the 27th November, 2021, with the theme; Achieving Standardization in the Production, Pricing and Supply of Nigeriaâ€™s Vegetable Value Chain. The Raise a Famer Initiativeâ€™s (RAFI) SAFE summit is expected to accommodate about a hundred and twenty (120) people in attendance and this includes the medium and small scale famers.</p>', '2021-11-27', '2021-11-27', 'uploads/1636224813mail4D9C8C96_5287_4760_9089_60A774C01E90.png', '1599234365sni7p8i5te6c1819rtau3na8rlo', '06:15:20', '2021-11-06', 'thumbs/1636224813mail4D9C8C96_5287_4760_9089_60A774C01E90.png', 0, '10am', 'hall C (comfort hall), AB hotel and emporium, Olora layout, along housing road, Ado Ekiti, Ekiti State', 'Raise a Farmer Initiative', '<p>Raise a Farmer Initiative&nbsp;</p>', NULL, NULL, 'show', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-11-27', NULL, 74, NULL, '1', 'SAFESummit', NULL, 'BGRT64GF', 1123, NULL, 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
