(153, '6TH Gear Revolution', 'EVT_16375902832932', '<p>Forget money! Go for Knowledge. Knowledge is the new currency. &nbsp;The value of knowledge is simply how you apply it.</p><p>You are now paid based on the value you can drive globally...</p><p>Entrepreneurs and venturing entrepreneurs have things to consider<br>1. Risk factor<br>2. Profit scalability</p><p>With minimal risk factors and higher profit, businesses can easily optimize and scale globally. Come and learn how to position yourself, forget what you have but come for the Knowledge you will acquire and how to apply it!</p>', '2021-10-31', '2021-10-31', 'uploads/163759028393068966gr_launch.jpeg', '16375842922d0t1icir07a6rr5hc1e6a6l', '02:11:23', '2021-11-22', 'thumb/163759028319871216gr_launch.jpeg', 0, '2:00pm - 4:00pm', 'Odilin Event Center, Behind National Library, along Joseph Gomwak Road, Jos, Plateau State', 'SFLD Hub', '<p>Strategic Financial Leadership Development (SFLD) Hub is business development agency in consultative status with the Century 21 Freedom Group. SFLD Hub works with individuals to raise capital to startup or expand their businesses by providing personal development and mentorship programs to develop individuals into financially sound leaders who are capable of controlling their own economy.</p><p><strong>Major Partners</strong></p><ul><li>Empowered Consumerism</li><li>Ego Blocks</li><li>Century 21 Freedom Group and more</li></ul>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Plateau', 'Jos', 31081, 2678, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'sfld', NULL, 'BGRT64GF', 15, 'Knowledge,Currency,Financial,Leadership,Development', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(154, ' MASS Campus Storm', 'EVT_16380343685393', '<p>MASS Campus Storm is an outreach of the MASS Movement - A creative youth worship and revival movement.</p><p>MASS Campus Storm EKSU features experience of WARship | Revival and PRAISE PARTY.</p><p>Follow @mass_movement for more.</p>', '2021-11-28', '2021-12-06', 'uploads/163803436891432IMG_20211116_WA0000.jpg', '1609528740i5nm3eaclle988tr2m39eau31', '05:32:48', '2021-11-27', 'thumb/16380343688677995IMG_20211116_WA0000.jpg', 0, '12:00am_11:59pm', 'RCF Auditorium, Ekiti State University', 'MASS Movement', '<p>MASS is a creative worship youth revival movement which has hosted thousands of youths and young adults in &nbsp;stadias and campuses in South West Nigeria.</p>', 'massmovementglobal', 'mass_movement', 'hide', '5.252234363610033', '7.71730041882567', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2021-12-18', NULL, 3350, NULL, '1', 'MASSCampusStorm', 1, '231r231002345433rrrr23', 923, 'WARship, Praise,Encounter', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
