(159, 'IGNITION 2.0', 'EVT_16396681652298', '<p>IGNITION is an inter-state/city to city special hangout for young minds and it poses to establish a connection between purpose, love and relationship as key ingredient to a successful life. It spurs young minds to greatness through exposure to hidden facts about life\'s purpose as well as relationships.<br>Ignition is a program whose aim is to instigate youths to a successful life through the teachings of the kingdom.<br>Her vision is to raise a generation of purpose-driven minds that will understand and build a godly and successful relationships which in turns affects the society positively through the teachings of the kingdom.<br>&nbsp;Her mission is to raise a generation into a life of positive impact by inspiring, empowering and mentoring young minds to finding and fulfilling their purpose, reconciling souls back to God, solving relationship issues, laying a solid foundation of purpose, love and relationship through the principles and teachings of the kingdom.</p>', '2021-12-28', '2021-12-28', 'uploads/1639803840mailWhatsApp_Image_2021_12_16_at_6.40.32_AM__1_.jpeg', '1609528740i5nm3eaclle988tr2m39eau31', '03:22:45', '2021-12-16', 'thumbs/1639803840mailWhatsApp_Image_2021_12_16_at_6.40.32_AM__1_.jpeg', 0, '10:00am', 'DLCF, Agbowo District, University of Ibadan', 'Comelymhe Impact Network', '<p>Comelymhe Impact Network is a multi-network organization that deals majorly on general life development,love and relationship with sexual purity,marriage and family life as well as an enterprise.<br>CIN enlighten youths on the need to develop a purposeful life alongside teaches about love and relationship (the God way)and helps bring back those who have missed the right way through the teachings of the kingdom- kingdom principles. &nbsp; &nbsp;&nbsp;<br>We creates true love and life values.</p>', 'Comelymhe Impact Network', NULL, 'show', '3.909147232277439', '7.4424418110857085', 'Nigeria [NG]', 'Oyo', 'Ibadan', 31064, 2677, 1