(170, 'The Scholarship Webinar', 'EVT_16427995967695', '<p>The Junior Chambers International is known for its commitment to creating impact and sustainable change in immediate communities.</p><p>JCIN EKSU has extended the organization\'s mission, to provide development opportunities that empowers young people to create positive change, by organising a webinar that will help Undergraduates in the Ekiti State University community to navigate Scholarship and funding opportunities for further studies.</p><p>We\'ll be having Dr. Muyiwa Igbalajobi of The Scholarship Cafe as a guest speaker at a virtual session scheduled to hold February 12, 2022. He will proffer solution and mentoring advice as to funding and Scholarship opportunities.<br>We believe this webinar will help Undergraduates in our collegiate community to create positive change in their locality, Nigeria and the world at large.</p>', '2022-02-12', '2022-02-12', 'uploads/1642956054mailWhatsApp_Image_2022_01_22_at_11.44.27_PM.jpeg', '1537374982obusn6a8u39t94101n5ol', '09:13:16', '2022-01-21', 'thumbs/1642956054mailWhatsApp_Image_2022_01_22_at_11.44.27_PM.jpeg', 0, '5:00pm - 6:30pm', NULL, 'JCIN EKSU', '<p>The Ekiti State University collegiate chapter of Junior Chambers International Nigeria is organising this Webinar to help undergraduates who want to navigate the waters of scholarship and funding opportunities for education outside the country.&nbsp;</p>', NULL, 'jcineksu', 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-02-13', NULL, 219, NULL, '1', 'JCINEKSUWEBINAR1', NULL, '231rcfr32', 768, '', 'free', NULL, NULL, NULL, 'Google Meet', 'a:4:{s:8:\"bGV2ZWw=\";a:5:{s:2:\"id\";s:8:\"bGV2ZWw=\";s:8:\"question\";s:5:\"level\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:5:{i:0;s:3:\"100\";i:1;s:4:\"200 \";i:2;s:4:\"300 \";i:3;s:3:\"400\";i:4;s:4:\" 500\";}s:8:\"required\";b:1;}s:48:\"RG8geW91IGhhdmUgcGxhbnMgdG8gc3R1ZHkgYWJyb2FkPw==\";a:5:{s:2:\"id\";s:48:\"RG8geW91IGhhdmUgcGxhbnMgdG8gc3R1ZHkgYWJyb2F