(186, 'Hultprize EKSU', 'EVT_16452893237879', '<p>Building a better world has become imperative for the whole wide world<br>The constant change that changes all systems has made incessant innova<br>tion expedient among every youth.<br>Hult Prize is a foundation that has provided training programs for millions<br>of students globally. In addition to this, the Hult Prize annually supports<br>brilliants startups with a grand prize of $1,000,000, which has gone a long<br>way to facilitate many thriving organizations in Africa and beyond. The fun<br>news is, it\'s Hult time again!<br>Hult Prize has opened the opportunity for all students with a vibrant<br>business ideas to pitch their idea at EKSU Hult prize on-campus event<br>this season.</p>', '2022-03-04', '2022-03-04', 'uploads/164528932370294071336F342_21D3_4371_9592_544BCAA42EB1.jpeg', '1645114013ie4ti741c7s154teaulrnoj60', '04:48:43', '2022-02-19', 'thumb/164528932330976361336F342_21D3_4371_9592_544BCAA42EB1.jpeg', 0, '10:30am', 'EKSU TECH HUB', 'Badejo oluwatoyosi', '<p>Students of Ekiti State University, Ado Ekit, Nigeria.&nbsp;</p>', NULL, 'HPEkitiStateUni', 'show', '', '', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2022-03-02', NULL, 172, NULL, '1', 'Hultprize_EKSU', NULL, '231r23100', 675, '', 'free', NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#ff00a2', NULL, NULL, NULL),
