(208, 'THE ED PLAN 3.0 PROJECT', 'EVT_16506184587914', '<p>The ED PLAN 3.0 is a global project powered by C21FG INTERNATIONAL/MILLIONAIRES ACADEMY, an independent business initiative.<br>The group is currently conducting a cash flow survey designed to ascertain if Nigerians prefer to have paid employment, working for someone or to own a business of their own, be their own boss.</p><p>Participate in our survey today, to be among the few selected individuals.</p>', '2022-05-16', '2022-06-30', 'uploads/16506184586229205images__1_.jpeg', '1619191527_9905997', '09:07:38', '2022-04-22', 'thumb/16506184583270661images__1_.jpeg', 0, '07:00pm', 'The ED PLAN 3.0 is a global project powered by C21FG INTERNATIONAL/VISION BUSINESS HUB, an independent business initiative.The group is currently conducting a cash flow sovey designed to ascertain if Nigerians prefer to have paid employment, working for someone or to own a business of their own, be their own boss.  Participate in our survey today, to be among the few selected individuals.', 'Powered by: C21FG Int\'l', '<p>Century 21 Freedom Group International, show individuals alternative ways to access capital to start a business, fund an existing business or fund projects without dropping collaterals, without taking loans and without paying back the funds generated.</p>', NULL, NULL, 'show', '', '', 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, 1, '2022-06-30', NULL, 995, NULL, '1', 'EDPLAN3.0-PROJECT-form', NULL, '231rcfr32', 759, 'La buena vida project,aimworld,21st century CEO', 'free', NULL, NULL, NULL, '--Select Virtual Platform--', 'a:18:{s:48:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nPw==\";a:5:{s:2:\"id\";s:48:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nPw==\";s:8:\"question\";s:34:\"1. How long have you been working?\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:4:{i:0;s:9:\"1-3 years\";i:1;s:9:\"4-7 years\";i:2;s:17:\"More than 7 years\";i:3;s:12:\"Never worked\";}s:8:\"required\";