(212, 'THE ED 3.0 PLAN PROJECT', 'EVT_16519583574377', '<p>The ED PLAN 3.0 project is a global project powered by C21FG INTERNATIONAL/MILLIONAIRES ACADEMY, an independent business initiative.</p><p>&nbsp;The group is currently conducting a cash flow survey Designed to ascertain if Nigerians would prefer to have a paid employment i.e working for someone or to own a business of their own I.e to be their own boss.</p><p>Participate in our survey today to be among The few selected individuals.</p>', '2022-05-07', '2022-05-21', 'uploads/16519583572452769images.jpeg', '1651956638_1023567', '09:19:17', '2022-05-07', 'thumb/16519583571195731images.jpeg', 0, '12:00', NULL, 'Powered by C21FG INT\'L', '<p>century 21 freedom group international shows individual alternative ways to access capital to start a business, fund an existing business, or fund projects without dropping collaterals, without taking loans from banks and without paying back the funds generated.</p>', NULL, NULL, 'hide', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-06-30', NULL, 997, NULL, '1', 'EDPLAN3.0-PROJECTS-FORM', NULL, '231rcfr32', 15, NULL, 'free', NULL, NULL, NULL, '--Select Virtual Platform--', 'a:17:{s:120:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nLiAxLTMgeWVhcnMsIDQtNyB5ZWFycywgTW9yZSB0aGFuIDcgeWVhcnMsIE5ldmVyIHdvcmtlZC4u\";a:5:{s:2:\"id\";s:120:\"MS4gSG93IGxvbmcgaGF2ZSB5b3UgYmVlbiB3b3JraW5nLiAxLTMgeWVhcnMsIDQtNyB5ZWFycywgTW9yZSB0aGFuIDcgeWVhcnMsIE5ldmVyIHdvcmtlZC4u\";s:8:\"question\";s:90:\"1. How long have you been working. 1-3 years, 4-7 years, More than 7 years, Never worked..\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:4:{i:0;s:9:\"1-3 years\";i:1;s:9:\"4-7 years\";i:2;s:17:\"More than 7 years\";i:3;s:12:\"Never worked\";}s:8:\"required\";b:1;}s:224:\"My4gQXJlIHlvdSBsaXZpbmcgeW91ciBkcmVhbSBsaWZlPyBOT1QgWUVULCAgIFlFUywgICBJVCdTIE9OTFkgRk9SIFRIRSBSSUNIIDQuIFdpbGwgeW91ciBjdXJyZW50IGpvYiBvciBidXNpbmVzcyBnaXZlIHlvdSB5b3VyIGRyZWFtIGxpZmVzdHlsZSBpbiB0aGUgbmV4dCAzIHRvIDUgeWVhcnM/\";