(213, 'ENACTUS NIGERIA NATIONAL COMPETITION 2022', 'EVT_16524337895552', '<p>Prepare to experience Passion on Purpose. We are excited for you to join us for this Enactus Online National Competition which will include competition, project and team feedback, recognition of accomplishments and impact, partner/student engagement, and at the end, one team will advance to the prestigious Enactus World Cup 2022</p>', '2022-06-13', '2022-06-17', 'uploads/1652637128mailENACTUS.png', 'j90819542aBn72i', '09:23:09', '2022-05-13', 'thumbs/1652637128mailENACTUS.png', 0, '10:00am-5:00pm', 'Eko Hotels and Suites, Lagos State, Nigeria', 'Enactus Nigeria', '<p>Enactus is the largest experiential learning platform dedicated to creating a better world while developing the next generation of entrepreneurial leaders and social innovators. A network of global business, academic and student leaders unified by a vision to create a better, more sustainable world, the organization also provides a platform for NextGen Leaders to develop leadership skills while working with leading companies worldwide.</p><p>In 2019, Enactus projects impacted 2.9 million lives, helped launch 3,000 small businesses, and eliminated 5.9 million tons of CO2, plus 819,699 women gained new skills to advance economic equality.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, 2, '2022-05-31', NULL, 8, NULL, '1', 'ENNC2022', NULL, '231rcfre2', 112, '', 'free', NULL, NULL, NULL, NULL, NULL, '1143951567_1652958849', NULL, '7225618195_1652957029', NULL, NULL, NULL, NULL, 'a:3:{s:20:\"RWJ1a2EgRXplamkvYWxs\";a:5:{s:2:\"id\";s:20:\"RWJ1a2EgRXplamkvYWxs\";s:4:\"name\";s:11:\"Ebuka Ezeji\";s:11:\"designation\";s:7:\"Speaker\";s:5:\"about\";s:23:\"Marketing Lead, Veralda\";s:5:\"image\";s:37:\"uploads/165253208935257base_image.jpg\";}s:20:\"QXlvZGVqaSBPam8vYWxs\";a:5:{s:2:\"id\";s:20:\"QXlvZGVqaSBPam8vYWxs\";s:4:\"name\";s:11:\"Ayodeji Ojo\";s:11:\"designation\";s:7:\"Speaker\";s:5:\"about\";