(216, 'ANNIVERSARY CELEBRATION', 'EVT_16534252144810', '<p>Celebrating one year of God\'s goodness to a troubled world.</p>', '2022-07-03', '2022-07-03', 'uploads/1653425214569360820220321_102714.jpg', '1653425380_7829965', '08:46:54', '2022-05-24', 'thumb/1653425214584344420220321_102714.jpg', 0, '12pm', 'Worship House, Kashim Ibrahim Street, Jos NG', 'The Dew Global Ministry', '<p>The Dew Global Mnistry began July 4, 2021 and by the grace of God has come through about a year of active commitment to Kingdom building. Nothing is too small or too big to honor Jesus with. One year is not too small. Jesus gives high regards to what we do we the little we have than what we do with much.</p><p>In view of this blessing, we are delighted to give Him our very best for the grace to experience one full year of His unaltered goodness to our world.</p>', NULL, NULL, 'hide', '', '', 'Nigeria [NG]', 'Plateau', 'Jos', 31081, 2678, 160, 1, '2022-06-15', NULL, 9, NULL, '1', 'thedewanniversary', NULL, '231rcf34re2', 7, 'The Dew, anniversary, worship house', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
