(221, 'ArtMesh: Open Mic & MeetUp for Creatives', 'EVT_16585038171258', '<p>ArtMesh is a program dedicated to amplifying creativity in Lagos, Nigeria and Africa - one step at a time.&nbsp;<br><br>We harness the power of youthful and social interactions to promote contents shared and discussed during our programs.&nbsp;<br><br>Performances can be from any and everyone.&nbsp;<br><br>We are giving you the mic because we want to hear your story.&nbsp;<br><br><strong>OUR DISCUSSION&nbsp;</strong><br>Perhaps one of our most important REFINEMENT is that of our DISCUSSIONS, usually themed around social issues/concerns affecting creatives/youths of contemporary age.&nbsp;<br><br><strong>VENUE&nbsp;</strong><br>American Corner, Ikeja has been home for ARTMESH and continues to house numerous creatives monthtly. All coming for a piece of art from the community.&nbsp;<br><br>ArtMesh is gradually growing into a well-recognized and respected creative program with links to many other creative events in and out of Lagos State.&nbsp;<br><br><br><i><strong>Time: 2.00pm - 5.00pm&nbsp;</strong></i><br>&nbsp;</p>', '2022-08-05', '2022-08-05', 'uploads/16585038167716684ARTMESH_landscape.jpg', '36au8m1elEn53m8538', '03:30:17', '2022-07-22', 'thumb/16585038164934668ARTMESH_landscape.jpg', 0, '02:00pm - 05:00pm', '42, Local Airport Road (Concord Busstop), Ikeja, Lagos', 'ArtHut', '<p>ARTHUT is an organization dedicated to amplifying creativity from Africa to the world.</p>', '@arthutng', 'arthutng', 'hide', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'artmeshaug22', NULL, '231r231002345433rrrr23', 132, 'open mic,conference,american corner ikeja,poetry,arthut,arthut events,lagos events,art event,art event Lagos,storytelling,karaoke,singing', 'free', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
