(223, 'DEMO CONFERENCE', 'EVT_16605789981915', '<p>This year\'s summit is focused on the sub-Sahara African agricultural vegetable value chain ecosystem.</p><p>The event is designed to ignite discussions around value addition in the vegetable value chain and it\'s primary potentials to promote, foreign exchange earnings, international trade and Agro-tourism.</p><p>The theme for SAFE SUMMIT 3.0 is DEMO</p><p>This year will play host to policy makers, thought leaders in the vegetable value and supply chains, and insightful panel sessions.</p>', '2022-08-21', '2023-12-23', 'uploads/1660604033mailBlue_And_Purple_Modern_Business_Conference_Instagram_Post.png', '1537374982obusn6a8u39t94101n5ol', '03:56:38', '2022-08-15', 'thumbs/1660604033mailBlue_And_Purple_Modern_Business_Conference_Instagram_Post.png', 0, '9AM TO 5PM ', 'DEMO,', 'DEMO', '<p>We are global focused&nbsp;</p>', NULL, NULL, 'hide', '', '', '160/Nigeria [NG]', '2671/Lagos', '30987/Surulere', NULL, NULL, NULL, 1, '2022-09-11', NULL, 98, NULL, '1', 'demo', NULL, '231rcfre2', 168, '', 'paid', 'categorized', '5', '1', 'Zoom', NULL, NULL, NULL, '8506114572_1660604904', NULL, 'NGN', NULL, NULL, 'a:3:{s:16:\"Sm9obiBEb2UvYWxs\";a:5:{s:2:\"id\";s:16:\"Sm9obiBEb2UvYWxs\";s:4:\"name\";s:8:\"John Doe\";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057930563622base_image.jpg\";}s:16:\"SmFuZSBEb2UvYWxs\";a:5:{s:2:\"id\";s:16:\"SmFuZSBEb2UvYWxs\";s:4:\"name\";s:8:\"Jane Doe\";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057932693682base_image.jpg\";}s:12:\"SmFuZSAvYWxs\";a:5:{s:2:\"id\";s:12:\"SmFuZSAvYWxs\";s:4:\"name\";s:5:\"Jane \";s:11:\"designation\";s:8:\"Speaker \";s:5:\"about\";s:17:\"Digital Marketer \";s:5:\"image\";s:37:\"uploads/166057936331495base_image.jpg\";}}', NULL, 'a:3:{s:7:\"zoom_dc\";s:0:\"\";s:14:\"meeting_number\";s:0:\"\";s:16:\"meeting_password\";s:0:\"\";}', 'Event', N