(224, 'ArtMesh: Open Mic + MeetUp for Creatives / September 2022', 'EVT_16611812188311', '<h4><i><strong>a friendly evening curated to promote originality, and community and amplify creative voices. This is ARTMESH!&nbsp;</strong></i><br><br><br><strong>ABOUT ARTMESH&nbsp;</strong><br><br>ArtMesh is a fun and open environment for writers, storytellers, spoken word artists, poets, and everyone else involved in the creative space.&nbsp;<br><br>Whether you are a performer, a lover of art/literature, or a friend to one, we\'d love you to join us!&nbsp;<br><br>If you are interested in performing, kindly contact the host upon arrival or send a message via WhatsApp (+2348117230203)&nbsp;<br><br>We look forward to hosting new and experienced writers and performers.&nbsp;<br>&nbsp;</h4><figure class=\"media\"><oembed url=\"https://youtu.be/ImeFHWNwsjw\"></oembed></figure><h4>&nbsp;</h4><h4><br>VENUE&nbsp;<br>American Corner, Ikeja has been home for ARTMESH and continues to house numerous creatives monthtly. &nbsp;<br><br>Time: 2.00pm - 5.00pm [MeetUp Commences after the program]</h4>', '2022-09-02', '2022-09-02', 'uploads/16611812189327084ARTMESH_Landscape_Banner.jpg', '1608781742ar872utth2l2ta8iec335r', '03:13:38', '2022-08-22', 'thumb/1661181218979673ARTMESH_Landscape_Banner.jpg', 0, '2:00pm - 5:00pm', 'American Corner, Ikeja, 42, Local Airport Road (Concord Bus Stop), Ikeja, Lagos State, Ikeja', 'ArtHut', '<p>ArtHut is an initiative dedicated to AMPLIFYING CREATIVE VOICES FROM AFRICA TO THE WORLD</p>', 'arthutng', 'arthutng', 'show', '', '', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'artmeshsept22', NULL, '231rcfre2', 37, 'arthut,artmesh,artmesh september,open mic,open mic lagos,lagos events,art,poetry,poetry events,storytelling,storytelling events in lagos,things to do in lagos,September events', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Event', NULL, NULL, NULL, NULL, NU