(230, 'AFRICA UNITE 2022', 'EVT_16619438402434', '<p>ONE THOUSAND IN A ROOM<br><br>Africa Unite is a convention where change makers in Africa get to interact, contribute and provide solutions to issues surrounding grassroots development in Africa.<br><br>We believe that a room with brilliant and passionate changemakers and idealists in Africa will accelerate the fulfillment of the 2030 agenda. To accomplish the objectives of sustainable development in Africa, we are banking on \'Africa Unite\'.</p>', '2022-10-15', '2022-10-15', 'uploads/16643540005578203Screenshot__1_.png', '1661467841_8888099', '11:04:00', '2022-08-31', 'uploads/16643540005578203Screenshot__1_.png', 0, '10am - 3PM', NULL, 'Lead Foot Prints Africa', '<p>Lead Footprints Africa is a non governmental organization that focuses on Human Right advocacy and Sensitization.&nbsp;</p>', NULL, NULL, 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, 1, '2022-09-30', NULL, 998, NULL, '1', 'AFRICAUNITE', NULL, '231rcfr32', 161, '', 'free', NULL, NULL, NULL, 'Google Meet', 'a:6:{s:20:\"T3JnYW5pemF0aW9uIA==\";a:5:{s:2:\"id\";s:20:\"T3JnYW5pemF0aW9uIA==\";s:8:\"question\";s:13:\"Organization \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:12:\"Q291bnRyeSA=\";a:5:{s:2:\"id\";s:12:\"Q291bnRyeSA=\";s:8:\"question\";s:8:\"Country \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:8:\"Q2l0eSA=\";a:5:{s:2:\"id\";s:8:\"Q2l0eSA=\";s:8:\"question\";s:5:\"City \";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:64:\"V2hpY2ggZGlzY3Vzc2lvbiBmb3J1bXMgYXJlIHlvdSBpbnRlcmVzdGVkIGluID8=\";a:5:{s:2:\"id\";s:64:\"V2hpY2ggZGlzY3Vzc2lvbiBmb3J1bXMgYXJlIHlvdSBpbnRlcmVzdGVkIGluID8=\";s:8:\"question\";s:47:\"Which discussion forums are you interested in ?\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:3:{i:0;s:27:\"Leading SDG in communities \";i:1;s:24:\"The UN and African Youth\";i:2;s:40:\"Accelerating actions for the SDG in 2023\";}s:8:\"required\";b:1;}s:60:\