(244, 'Mckodev Award Fest 2023', 'SPD_16765636529613', '<p>McKodev Award Fest 2023 is an upcoming event that celebrates the achievements of exceptional individuals in the field of technology. The event will take place on December 18, 2023, and will feature a variety of exciting activities, including keynote speeches, panel discussions, and an award ceremony.</p><p>The festival will bring together professionals, innovators, entrepreneurs, and investors from across the technology sector to share knowledge, network, and celebrate the accomplishments of the most outstanding tech individuals in the industry. The focus of the event is to acknowledge and appreciate the impact that these individuals have made in the field of technology, and to inspire future generations of technology enthusiasts.</p><p>The event will showcase the latest trends and innovations in the tech world, featuring demonstrations of cutting-edge products and services. Attendees will also have the opportunity to engage in interactive workshops and discussions with industry experts, as well as network with other like-minded professionals.</p><p>The highlight of the event will be the award ceremony, which will recognize and honour the most exceptional individuals who have made significant contributions to the field of technology. Awards will be given in various categories, including but not limited to, software development, AI, cybersecurity, and entrepreneurship.</p><p>Overall, the McKodev Award Fest 2023 promises to be an unforgettable event that celebrates the best and brightest minds in the world of technology, while inspiring the next generation of innovators to push the boundaries of what\'s possible in the ever-changing world of technology</p>', NULL, NULL, 'uploads/16765636519642389mckodev.png', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '04:07:32', '2023-02-16', 'uploads/16765636519642389mckodev.png', 0, NULL, NULL, 'Mckodev Tech Lab', NULL, '@mckodev', '@mckodev', 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'MckodevAward-Fest2023', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
