(247, 'Garri Hangout 2023', 'SPD_16783742885218', '<p>Garri Hangout 2023 is an exciting event that celebrates the rich culture and heritage of West Africa through the consumption of Garri, a popular food staple made from cassava. The event is scheduled to take place on Tuesday, May 30th, 2023, at the National Stadium in Lagos, Nigeria.</p><p>&nbsp;</p><p>The event is expected to attract a diverse audience, including food enthusiasts, cultural enthusiasts, tourists, and Garri lovers from all over the world. It promises to be a fun-filled day of Garri tastings, cultural displays, live music performances, and networking opportunities.</p><p>&nbsp;</p><p>Attendees will have the opportunity to sample a wide variety of Garri dishes, ranging from the traditional Garri and soup to more modern twists on the classic dish, such as Garri smoothies and Garri ice cream. The event will also feature Garri vendors and producers, showcasing the different varieties of Garri available in the market.</p><p>&nbsp;</p><p>In addition to the food, there will be live music performances from some of Nigeria\'s biggest musicians, as well as cultural displays showcasing the rich traditions and heritage of West Africa. There will also be opportunities for attendees to learn more about Garri production and the role it plays in West African cuisine.</p><p>&nbsp;</p><p>Overall, Garri Hangout 2023 promises to be a unique and exciting celebration of West African culture and cuisine, bringing together Garri lovers from all over the world to share in the joy and delight of this beloved food staple.</p>', NULL, NULL, 'uploads/16783742876918171Testing.JPG', '16762792563mt5riglkc75e14t6nsvt4o7ca2eeid', '03:04:48', '2023-03-09', 'uploads/16783742876918171Testing.JPG', 0, NULL, NULL, 'Mr Envoy Oluwayomi', '<p>Garri Hangout 2023 is organized by a team of experienced event planners and cultural enthusiasts who are passionate about promoting West African cuisine and culture. The team comprises individuals with diverse backgrounds and expertise in event planning, marketing, culinary arts, and cultural heritage.</p><p>&nbsp;</p><p>The lead organizer is Mr Envoy Oluwayomi, a seasoned event planner with over a decade of experience in organizing cultural events in Nigeria and beyond. She is supported by a team of professionals who have worked on several successful events, including food festivals and cultural exhibitions.</p><p>&nbsp;</p><p>The organizing team has collaborated with local Garri producers and vendors to ensure a diverse range of Garri products are available for attendees to sample and purchase. They have also partnered with several cultural organizations to create a program that showcases the richness and diversity of West African culture.</p><p>&nbsp;</p><p>The organizing team is committed to ensuring that Garri Hangout 2023 is a safe and enjoyable event for all attendees. They have put in place measures to comply with local health and safety guidelines and will work closely with the relevant authorities to ensure a successful and memorable event.</p>', NULL, '@mckodev', 'hide', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'GarriHangout23', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'a:3:{s:41:\"16762792563mt5riglkc75e14t6nsvt4o7ca2eeid\";a:3:{s:11:\"designation\";s:9:\"Live Band\";s:4:\"user\";s:41:\"16762792563mt5riglkc75e14t6nsvt4o7ca2eeid\";s:6:\"usname\";s:25:\"mckodev_testing1676279256\";}s:15:\"j90819542aBn72i\";a:3:{s:11:\"designation\";s:9:\"Live Band\";s:4:\"user\";s:15:\"j90819542aBn72i\";s:6:\"usname\";s:8:\"banjella\";}s:31:\"1537374982obusn6a8u39t94101n5ol\";a:3:{s:11:\"designation\";s:4:\"Lead\";s:4:\"user\";s:31:\"1537374982obusn6a8u39t94101n5ol\";s:6:\"usname\";s:9:\"Thisisboj\";}}'),
