(290, 'Entrepreneurship Training for Young Ladies and Women in Ado Ekiti', '<p>ME INITIATIVES presents Entrepreneurship Training for Young Ladies and Women in Ado Ekiti.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Date: October 18 - 19, 2018.</p>\r\n\r\n<p>Time: 9am Daily.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Register <a href=\"https://bit.ly/2oFb1cu\" target=\"_blank\">Here</a></p>\r\n\r\n<p>&nbsp;</p>', '2000-01-01', '2000-01-01', 'uploads/1536689200490181315366884026447258IMG-20180911-WA0025.jpg', 'j90819542aBn72i', '18:05:46', '2018-09-11', '1536689146srerpe858r1tu8enp3etren0ip1h7ro', 'thumb/4497667thumb1536911570.jpg', 0, NULL, 'Address', NULL, NULL, NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Surulere', 30987, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '231rcfr32', 176, 'https://bit.ly/2oFb1cu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(291, 'Professional Pest Control & Funmigation Training (5th Edition)', '<p>Rotimax Integrated Services Ltd offers comprehensive pest control and fumigation training throughout Nigeria. Over the years, we have established a solid reputation for effective and quality training. Our pest control and fumigation training solutions are tailored to allow you to become proficient with the latest methods in pest control and pest management, providing you with detailed manuals and practical training on how to safely and legally exterminate rats,mice, mosquitoes ,bed bugs, cockroaches, snakes, tick,lice,flies and the rest.<br><br>Our fumigation and pest control training is endorsed by Environmental health association of Nigeria (E.H.O.A.N) and Pest control association of Nigeria (P.E.C.A.N). We have previously collaborated with government agencies and private bodiesalso i.e Lagos state ministry of Environment, Cleaning practitioners of Nigeria (CPAN) in conjunction with Alcochem Hygiene, Netherlands.</p>', '2018-10-26', '2018-10-27', 'uploads/15369183119776789DmgaBMNWsAAZToH.jpg', 'j90819542aBn72i', '09:44:40', '2018-09-14', '15369182809rto49sp9nf7rle9o7sr4o5e3iap', 'thumb/6627602thumb1536918754.jpg', 1, '9am', 'LCCI CONFERENCE CENTER, ALAUSA-IKEJA LAGOS', 'ROTIMA', '<p>.</p>', NULL, NULL, 'show', '3.3514863000000332', '6.601838', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'PPCF', NULL, '231r23cfre87', 1107, 'http://training.rotimax.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(292, 'Reporting the Illegal Internet Trade in Wildlife', '<p>Thomson Reuters Foundation is offering a training scheme on Reporting the Illegal Internet Trade in Wildlife for journalists from Africa and Asia, in partnership with The Global Initiative Against Organized Crime (GIATOC) funded by the Government of Norway.</p>\r\n\r\n<p>In marketplaces across the world the illegal wildlife trade is booming, and enormous, irreparable damage to biodiversity is occurring. Hundreds of thousands of endangered and legally protected plants, insects and animals are harvested and traded every day to consumers interested in their medical, ornamental, cultural properties, or to keep them as live pets or plants.</p>\r\n\r\n<p>The marketplaces for illegal wildlife products are increasingly virtual and there is an important shift to the marketing and sale of environmental commodities on the internet. As the &lsquo;online&rsquo; aspect of the illegal wildlife trade grows in importance, we will bring together journalists from Africa and Asia to attend this workshop aimed to enable journalists to tell the story of the illegal online wildlife trade.</p>\r\n\r\n<p>The intensive five-day workshop, taking place in Bangkok, Thailand from Monday, 05 November &ndash; Friday, 09 November will build the capacity of journalists to report on the issue of illegal online wildlife trade &ndash; improving both knowledge and skills and also help journalists to present new viewpoints, promote discussion and dialogue on the most strategic areas for intervention.</p>\r\n\r\n<p><strong>WORTH</strong></p>\r\n\r\n<p>Successful applicants will receive a full bursary that will cover air travel expenses (economy class), accommodation, local transfers and meals. Please note that you need to check visa requirements and ensure you have the necessary documentation required. The cost of your visa and any other related costs will be the responsibility of the participant.</p>\r\n\r\n<p><strong>ELIGIBILITY</strong></p>\r\n\r\n<ul>\r\n	<li>This is an opportunity for journalists from across Africa and Asia working for established media organisations.</li>\r\n	<li>Applicants must be full-time journalists or regular contributors to a media organisation.</li>\r\n	<li>Applicants must be able to demonstrate a commitment to a career in journalism in their country, should have at least five years&rsquo; professional experience and have a good level in spoken and written English.</li>\r\n</ul>\r\n\r\n<p><strong>DEADLINE:</strong>&nbsp;September 24 2018</p>', '2000-01-01', '2000-01-01', 'uploads/15369191481955119pic-1-5.jpg', 'j90819542aBn72i', '09:57:18', '2018-09-14', '1536919038pr8g2otrror4ein7466p60e4t', 'thumb/7434184thumb1536919211.jpg', 1, NULL, 'Address', NULL, NULL, NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Surulere', 30987, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '231rcfr32', 196, 'https://www.surveygizmo.com/s3/4567137/Reporting-the-Illegal-Internet-Trade-in-Wildlife-Workshop', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(293, 'Advance Digital Marketing Master Class', '<p>Recession has devalued all forms of money. Come and see how you can advance your career and double the profit of your business. FMG PLATFORM presents DIGITAL MARKETING FOR SMALL BUSINESSES.</p><p>Friday 21st September 2018.</p><p>10am to 3pm<br>For inquiries call us on 08109764875.</p>', '2018-09-21', '2018-09-21', 'uploads/15372649241633076IMG_20180918_105004.jpg', 'j90819542aBn72i', '09:55:50', '2018-09-18', '1537264550560d36vp9earn3tc7erao49', 'uploads/15372649243025495IMG_20180918_105004.jpg', 1, '10AM', 'WUSE ABUJA', 'FMG PLATFORM', '<p>.</p>', NULL, NULL, 'hide', '7.398574000000053', '9.0764785', 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'ADMMC', NULL, '231r23cfre2', 194, 'https://facebook.com/fmgplatform', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
