(298, 'Document Control and Management', '<p>Our Lead Document Control and Management training is certified by <a href=\"https://twitter.com/ILM_UK\">@<strong>ILM_UK</strong></a>â € This training will hold from Oct.29th-Nov.2nd, 2018 @ the Cedar Centre, Yaba, Lagos. Take charge of your career. For registration Call 08139112519 or Email training@lonadek.com&nbsp;</p>', '2018-11-29', '2018-11-29', 'uploads/15402101834059175Document_Control_and_Management_001.jpg', '15396186570fi87788e78m94', NULL, '2018-10-22', '15402101830d1n6rmnctt1u68an257oigie', 'thumb/1540210183808187Document_Control_and_Management_001.jpg', 0, '9am', 'The Ceder Center Lagos', 'Lonadek', '<p>.</p>', NULL, NULL, 'show', '3.379205700000057', '6.5243793', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'DCAM', NULL, '231r23cfre87', 939, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(299, 'Learn to Code at Thecodecenter.org', '<p><strong>FRONT WEB DEVELOPMENT </strong>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration: N20,000</p><p>Training Fee: N300,000</p><p>A Front End Web Developer is responsible for implementing visual and interactive elements that web users engage with through their browsers when using web applications. They work alongside Web Developers, who are responsible for server-side application logic and integration of the work Front End Developers do.</p><p>By the end of this programme, our participants would be able to tick the following boxes as success metrics:</p><p>Possess solid understanding of Web Mark-up Languages â€“ HTML and CSS</p><p>Can translate Mockups designed by UI/UX people into actual codes</p><p>Solid understanding of server-side CSS pre-processing platforms such as LESS and SASS</p><p>Solid understanding of code versioning tools such as GIT</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>&nbsp;</p><p><strong>SOFTWARE DEVELOPMENT IMMERSIVE</strong></p><p>&nbsp;Duration: &nbsp; &nbsp; &nbsp; 6 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N600,000</p><p>Our flagship course â€“ specially designed for school leavers aspiring to study Computer Science or related courses in the University (or any Higher Institution). The goal is to turn them into professional Software Developers such that they would be able to take advantage of the opportunities that await them by the time they eventually gain admission. (However, any interested person can also apply). As with all of our programs intended to turn participants to skilled experts, successful participants of this program are guaranteed an easy navigation of the Computer Science course throughout the University. Feedback from some of the alumni of this course has it that the program helped position them several steps ahead of their colleagues in the University.</p><p><strong>WEB DEVELOPMENT IMMERSIVE</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>As the online World is largely powered by some vast Internet Technologies, the knowledge of how to develop, deploy and manage Web applications is in such a high demand. As a Web Developer, you use your skills to build Websites and Web Applications; creating products that meet clientsâ€™ needs. Our Web Development curriculum has been thoughtfully crafted to initiate participants (irrespective of their academic background) into the world of Web Applications development within a space of 16weeks such that by the time they are done, they would be able to tick the following boxes as success metrics</p><p>Can function as an entry-level developer</p><p>Possess hands on knowledge of how to architect the components of an application</p><p>Can elicit project requirements from clients and users</p><p>Can convert ideas into digital form (having worked on multiple projects in the course of their training.</p><p>Can develop and maintain/manage databases</p><p>Can build and test APIs (Application Programming Interfaces) for exchange of data between applications</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>Possession/Development of analytical thinking skills and problem solving mindset</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>USER EXPERIENCE DESIGN</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 6 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>In this course, we first teach you how to create and style Web Pages using HTML and CSS. Thereafter, we introduce you to design concepts such as how to conduct&nbsp;User Research, how to illustrate design ideas using&nbsp;story boards&nbsp;&amp;&nbsp;process flows, translating these concepts into&nbsp;wireframes,&nbsp;mockups&nbsp;and&nbsp;prototypes&nbsp;that lead to&nbsp;intuitive user experiences; helping you unleash your design creativity. And then, you begin to apply the knowledge obtained so far on real life projects â€“ both at an individual level and alongside a team of designers and developers</p><p>By the end of this program, our participants would be able to tick the following boxes as success metrics:</p><p>Solid understanding of HTML,&nbsp;CSSand JavaScript</p><p>Ability to create mockups/prototypes using Photoshop, Invision, Adobe XD, Figma for Web and Mobile Applications</p><p>Robust portfolio of about 4 to 6 projects that are presentable during job interviews or project bids</p><p>Possession/Development of analytical thinking skills and problem solving mindset</p><p>Possession of some of the soft skills required to work with a team</p><p>&nbsp;</p><p><strong>JAVA PROGRAMMING</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 4 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N300,000</p><p>The Java Programming Language is one of the worldâ€™s most widely used Computer Programming Language â€“ Itâ€™s application most found in Enterprise Software, Embedded Systems and the likes. &nbsp;Our foundational Java Programming Course is a 4-month program designed to help participants establish a solid foundation in the languageâ€™s paradigm; placing them on a good pedestal for a successful career in Software Development.&nbsp;</p><p>By the end of the program, participants will be able to tick the following boxes as success metrics:</p><p>Possess solid understanding of the J2EE framework, Relational Databases, Object Oriented Analysis and Design</p><p>Develop applications (software) using the Java Programming Language</p><p>Gather requirements/analyze user specifications for Software Projects</p><p>Develop logic flowcharts for Java Programs</p><p>&nbsp;</p><p><strong>ANDROID DEVELOPMENT</strong></p><p>Duration: &nbsp; &nbsp; &nbsp; 3 Months</p><p>Registration: N20,000&nbsp;</p><p>Training Fee: N200,000</p><p>An Android Developer is responsible for developing applications for mobile devices powered by the Android Operating System â€“ one of the most popular mobile operating systems.</p><p>Our Android Development course is a 3-month intensive program by the end of which participants would be able to tick the following boxes as success metrics&nbsp;</p><p>Participants would be well grounded in the knowledge of Android SDK, its different versions and how to handle different screen sizes</p><p>Participants would possess sound knowledge of Android UI design principles and patterns</p><p>Participants can translate mobile app specification/requirements into codes</p><p>Participants would be familiar with RESTful APIs required to connect Android applications to back-end services</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '2000-01-01', '2019-11-12', 'uploads/15402870517313780IMG-20181023-WA0003.jpg', 'e238t723ts7106', NULL, '2018-10-23', '1540287051t38ganir5i1el847364narn', 'thumb/15402870518258608IMG-20181023-WA0003.jpg', 0, '12pm', 'Address', 'TheCodeCenter', '<p>TheCodeCenter is a knowlegde factory where we take in people as raw materials and turn them into sought-after technology talents by the end of there program with us.</p><p>Build Lifelong Relationship</p><p>Our learning atmosphere is characterized by strong inter-personal relationships among everyone - more like home away from home.</p><p>Learn Under Veteran Instructors/Practitioners</p><p>Our Instructors are veteran practitioners in their field / naturally talented teachers</p><p>An Eye For The Future</p><p>At the heart of our operations is an obligation to help our participants build a successful career in their chosen course of study with us.</p>', NULL, NULL, 'show', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, 1, '2019-12-24', NULL, 122, NULL, NULL, 'thecodecenter', NULL, '231rcfre232', 1734, 'http://www.thecodecenter.org', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(300, 'Women ICTpreneurs Nigeria', '<p>Women ICTpreneurs Nigeria (WIN) is a program by Tech ME is aimed at empowering unemployed young Nigerian women with ICT skills for them to start an income-generating activity. Over a 6 month period, Tech ME will deliver web development and graphic designing training to 60 underserved women. Women ICTpreneurs Nigeria will also bridge the technology gender gap in Nigeria by training more women to be techpreneurs.</p><p>Women ICTpreneurs Nigeria supports the UN Sustainable Development Goal 1 (No Poverty) Goal 5 (Gender Equality), Goal 8 (Decent Work and Economic Growth).</p>', NULL, NULL, 'uploads/15404988365768505IMG_20181025_211400_108.JPG', 'e238t723ts7106', NULL, '2018-10-25', '15404986449wita1626em0g76irn67onn', 'uploads/15404988368727824IMG_20181025_211400_108.JPG', 0, '', 'Lagos', 'TECH Me', '<p>Tech ME is a non-profit organisation leveraging technology to solve social issues. Our core focus areas are; education, entrepreneurship and civic engagement. Since inception, we have implemented coding training for teenagers and empowered youth and women with ICT skills to start their own business. Our programs have directly imparted more than 1000 lives.</p>', 'techmeicthub', 'techmeicthub', 'show', '3.379205700000057', '6.5243793', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'techme', NULL, '231rcf34re2', 2179, 'https://techmeng.org', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
