(302, 'Document Control and Management', '<p>We offers value-adding, expertly facilitated, and cost-friendly training in Lead Document Control and Management Training for all interested participants. Call us today on +2348139112519 for more info.</p>', '2000-01-01', '2000-01-01', 'uploads/15405495558796200Document_Control_and_Management_001.jpg', '15396186570fi87788e78m94', NULL, '2018-10-26', '15405495553giec15a9r5mt6ntndo0n5i9u', 'thumb/15405495555623791Document_Control_and_Management_001.jpg', 0, NULL, 'Address', 'Lonadek', '<p>&nbsp;</p>', NULL, NULL, 'hide', NULL, NULL, 'Nigeria [NG]', 'Lagos', 'Surulere', 30987, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '231rcfr32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(303, 'ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER (For Women)', '<p>HEIR WOMEN DEVELOPMENT</p><p>In view of the World Entrepreneurship Week, HEIR WOMAN is organizing a workshop for women development which is Focused on ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER.&nbsp;</p><p>Venue : American Corners Abuja. National Center for Women Development. Central Business District, Abuja.</p>', '2018-11-13', '2018-11-13', 'uploads/15416393145121040DraO1soW4AA_Q7A.jpg', 'e238t723ts7106', NULL, '2018-11-08', '1541639314n50nuene9rhrs66r3p3niii7agt5repe5t', 'thumb/15416393148805041DraO1soW4AA_Q7A.jpg', 0, '10AM', 'American Corners Abuja', 'HEIR WOMEN DEVELOPMENT', '<p>HEIR WOMEN DEVELOPMENT</p><p>In view of the World Entrepreneurship Week, HEIR WOMAN is organizing a workshop for women development which is Focused on ENTREPRENEURSHIP, INTRAPRENUERSHIP AND DIGITAL SKILLS FOR BUSINESSES AND CAREER.&nbsp;</p><p>Venue : American Corners Abuja. National Center for Women Development. Central Business District, Abuja.</p>', NULL, NULL, 'show', '7.398574000000053', '9.0764785', 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, 1, '2019-11-13', NULL, 500, NULL, NULL, 'HeirWomen', NULL, '231rcfre2', 1517, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(304, 'Sedab Skill Acquisition Programme', '<p>Sedab Impact House brings a Great Opportunity to all ADO-EKITI residents to become a PRO in TWO Months on one of these Skills:.</p><p>- Bag Design<br>- Fashion Design<br>- Shoe Design<br>- Makeup &amp; Auto Gele<br>- Hair Making<br>- Cake Baking and Design<br>- Graphics Design<br>- Web Design<br>- Solar Power Building<br>- Wall Painting</p><p>Embrace this Affordable and Reformable opportunity to Master a SKILL.</p><p>Training Date: 26th November, 2018 - 2nd February, 2019.</p><p>Training Venue: Sedab House, 8 Orire Hospital Lane, By the New Total Filling Station, Adebayo - Ado Ekiti.</p><p>Training Schedule:<br>Weekdays: Monday\'s - Thursday\'s.</p><p>Weekends: Friday\'s &amp; Saturdays ( For Students and Working Class).</p><p>Pick your Registration Form for #1,000 @ Sedab House, Along Orire Hospital Road, Adebayo, Ado-Ekiti.</p><p>Training Fee: #10,000.</p><p>Call: 08123804028 or 08068610522 for more details...</p><p>Terms and Conditions Apply...</p>', '2018-11-26', '2019-02-02', 'uploads/1541664148576557DrbwKNWXcAI0rP7.jpeg', 'e238t723ts7106', NULL, '2018-11-08', '1541664148i86d5rnn0gb3a8aes71i0t9', 'thumb/15416641483685459DrbwKNWXcAI0rP7.jpeg', 0, '8am', 'Ado Ekiti', 'Sedab Impact House', '<p>Sedab Impact House is a seasoned human capital and business enhancement impact based NGO geared with a vision to discover, equip and position individuals with business entrepreneurial skills and deploying them as assets to the society.</p><p>Sedab Skill Acquisition Programme started since 2012 with our first training in Ekiti State University and has since also held multiple trainings in Lagos, Ogun and Ondo State, deeply touching thousands of lives and has lots of testimonies resulting from this vision.</p><p>Our goal transform every individual we come in contact with from knowing little or nothing to becoming a Businesspreneur.</p>', 'sedabimpacthouse', 'sedabimpact', 'show', '5.237108700000022', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2019-01-31', NULL, 1000, NULL, NULL, 'SedabMasterClass', NULL, '231rcfre22', 1784, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(305, 'Global Entrepreneurship Week Digital Training', '<p>Google inc is organizing a free 1 day digital training on the 12th November 2018 @ AEA Entrepreneurial Complex, Plot 74, Zone B15, Jahi, Abuja. CONTACT 08160307118</p>', '2018-11-12', '2018-11-15', 'uploads/15416671334103606Dra6OMwWkAYX97O.jpg', 'e238t723ts7106', NULL, '2018-11-08', '1541667133i6an0l85n3a1bito6r2gl5g', 'thumb/15416671333437542Dra6OMwWkAYX97O.jpg', 0, '9am', 'Abuja', 'Abuja Enterprise Agency', '<p>Abuja Enterprise Agency (AEA) is the FCT vehicle for Small and Medium Enterprise (SME) development and poverty reduction. It was set up by the Federal Capital Territory Administration (FCTA) in collaboration with the Small and Medium Enterprises Development Agency of Nigeria (SMEDAN), and with support of the United Kingdomâ€™s Department for International Development (DFID). The Agency as a fall out of implementing the FCT Economic Empowerment and Development Strategy (FEEDS) agenda was established in 2005 and was officially commissioned in February 2006. The Agency focuses on the development of micro, small and medium enterprises within the Federal Capital Territory (FCT), and aims to assist new and existing entrepreneurs to overcome obstacles to growth through access to finance, proper business planning, developing entrepreneurship skills, suitable work-space etc.</p><p>&nbsp;</p><h4>OUR MISSION</h4><p>To provide excellent support services by developing relevant programmes and activities to start and nurture Micro, Small and Medium Enterprises (MSMEs)</p><h4>OUR VISION</h4><p>To be the symbol of Entrepreneurial Development in Africa</p><h4>OUR CORE VALUES</h4><p>Integrity, Respect, Innovation, Excellence</p>', NULL, 'AEAtwit', 'show', '7.398574000000053', '9.0764785', 'Nigeria [NG]', 'Abuja Federal Capital Territor', 'Abuja', 48359, 2648, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'AEADIGITALTRAINING', NULL, '231r23cfre2', 863, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(306, 'Digital Marketing Training Class 12.0 [DMTClassNG]', '<p>Digital Marketing Training Class (DMTClassNG) is an intensive practical training geared toward expatiating what Digital Marketing is all about, how it works, how it can be used for brand awareness and increase business sales and profit.</p><p>Digital marketing is soaring in popularity because it is not only a rapidly growing force in the current marketing playing field but it is set to be the future of marketing in general.</p><p>Digital Marketing Training Class (DMTClassNG) aims at enabling Small and Medium Scale business owners know the important of Digital Marketing and how it can be used at attract prospective clients and turning these clients into loyal paying customers.</p><p>Digital Marketing Training Class (DMTClassNG) also aims at grooming individuals who will become world class Digital Marketing Experts.</p><p>Digital Marketing Training Class (DMTClassNG) is powered by Absolute Hearts Media, Nigeria\'s foremost Digital Marketing and Online Media company.</p><p>Courses to be taught include:<br>1. Introduction to Digital &amp; Social Media Marketing<br>2. SMS &amp; WhatsApp Marketing<br>3. Information Marketing<br>4. Email Marketing</p><p>5. SOCIAL MEDIA MARKETING:<br>a. Gaining Marketing edge with Social Media Marketing<br>b. Learning how to deploy social media tools (and automation tools) for business profit<br>c. The Social Media selling approach<br>d. Influencer marketing<br>e. Practicals on how to launch effective Social Media Sponsored Ads (Campaigns).<br>f. Intensive practical session on Social Media marketing, how to build social media pages to get huge followership &amp; social media optimization<br>g. Understanding Social Media analytics to measure business growth</p><p>6. SEARCH ENGINE OPTIMIZATION&nbsp;<br>a. Strategies to bring your website/brand on Google\'s first page&nbsp;<br>b. Pay Per Click Advertising (Google Adwords)</p><p>7. Blogging &amp; Content Marketing<br>a. Introduction to Blogging and Content Marketing<br>b. Practicals on setting up a professional blog<br>c. Managing a professional blog<br>d. Tools needed for Blogging<br>e. Monetizing your blog (making money from your blog)<br>f. Using Blogging a grow your business sales and awareness</p><p>8. In-depth revelation on opportunities in digital marketing and the digital space at large and how to start a profitable career in any of them (including social media marketing, Mobile Marketing/Bulk SMS, Blogging, Web Designing, SEO, Affiliate Marketing, Information Marketing, Email Marketing, etc).</p><p>9. How to build your own Digital Marketing Agency in 30 days and how to make Digital Marketing Agency profitable, bankable and trustworthy.</p><p>Bonus Courses (NEW)<br>1. Imagery (Designing images on your own)<br>2. Video creation (Creating videos on your own)</p><p>Other benefits of the training:<br>1. Participants will be awarded certificates at completion of the training.<br>2. Participants will be given access to private Digital Marketing mentoring Whatsapp and Facebook groups<br>3. Participants will also be given learning materials at the end of the training.</p><p>Date: January 26th and 27th 2019.<br>Saturday: 9am | Sunday: 2pm.<br>Venue: The Glass House. 1, Adegbeyeni Street, Behind Old Alade Market, Allen, Ikeja, Lagos.</p><p>Training fee: N20,000 (If payment is made on or before January 18th and N40,000 thereafter or at training venue)<br>You also get a FREE DATABASE GIFT worth N10,000 at the training venue.</p><p>For inquiries: 08027922363 (Call, WhatsApp)</p><p>Register here <a href=\"http://bit.ly/dmtclassng\">http://bit.ly/dmtclassng </a>&amp; proceed to make your payment. (You\'ll receive payment details via email after registering).</p>', '2019-01-26', '2019-01-27', 'uploads/15447951454886746DMTC.png', '1544793563df6a5lb09e3a74ze6hu5', NULL, '2018-12-14', '1544795145a2rn1igi0aldn378tit09i4g5', 'thumb/15447951457726184DMTC.png', 1, '9am', 'The Glass House. 1, Adegbeyeni Street, Behind Old Alade Market, Allen, Ikeja, Lagos.', 'Absolute Hearts Media', '<p>Absolute Hearts Media is a full blown Digital Marketing, Online Media and Brand Strategising company located in Lagos, Nigeria. We are also the owners of: 1. Digital Marketing Training Class (DMTClassNG) - A Digital Marketing Training Institute 2. Absolute Hearts Blog - A lifestyle and entertainment website (www,absolutehearts.com)</p>', 'dmtclassng', 'dmtclassng', 'show', '3.3514863000000332', '6.601838', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, 1, '2019-01-18', NULL, 500, NULL, NULL, 'DMTClassNG', NULL, '231r23cfre2', 1626, 'http://bit.ly/dmtclassng', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
