(311, 'IBM D-NA workshop', '<p>Weâ€™re pleased to announce IBM D-NA workshop.&nbsp;<br>Let\'s help you reach your 2019 goals by growing your career and businesses using digital skills.&nbsp;<br>Lonadek\'s Cedar STEM &amp; Entrepreneurship Hub (CSEH) is hosting IBM D-NA workshop. &nbsp;<br><br><br>Learn skills like;&nbsp;<br>- Cloud Technology&nbsp;<br>- Data Analytics&nbsp;<br>- BlockChain&nbsp;<br><br>- Internet of Things&nbsp;<br><br>- Artificial Intelligence etc.&nbsp;<br>IBM D-NA workshop is a 3 hour workshop facilitated by Lonadek Incorporated. If you are interested in acquiring 21st century skills for employability, &nbsp;<br><br><br><br>business growth or you are just looking to expand your skills in emerging technologies, then you should apply for this opportunity.&nbsp;<br>For every course you successfully complete, an IBM Digital Badge will be issued, which you can share on social media platforms like LinkedIn. &nbsp;<br><br><br><br>More importantly, as a registered D - NA user, you are entitled to a free IBM Cloud Lite account.&nbsp;<br>Opportunities are available to register for the Morning OR Afternoon Sessions.&nbsp;<br>Date: 8th February 2019&nbsp;<br>Venue:The Cedar stem and Entrepreneurship Hub 12, Jibowu street Yaba Lagos.&nbsp;<br><br><br><br>To attend, kindly register at https://lnkd.in/d63sqtP&nbsp;<br>For enquires call 08164339275 or send an email to info@thecedarcentre.org&nbsp;<br>#Cloudtechnology #Dataanalytics #digitalskills #blockchain #WednesdayMotivation #wednesdaywisdom #wednesdaythoughts #MellowWednesday #IBMCloud&nbsp;</p>', '2019-02-08', '2019-02-08', 'uploads/1573589624mail15488345715832269Dx5uOvxWsAAl6Ot__1_.jpg', '15396186570fi87788e78m94', NULL, '2019-01-30', '1548834571t45n0bnr1gi0m9ia703i6', 'thumbs/1573589624mail15488345715832269Dx5uOvxWsAAl6Ot__1_.jpg', 1, '9am', 'Address', 'Lonadek', '<p>Weâ€™re pleased to announce IBM D-NA workshop.&nbsp;<br>Let\'s help you reach your 2019 goals by growing your career and businesses using digital skills.&nbsp;<br>Lonadek\'s Cedar STEM &amp; Entrepreneurship Hub (CSEH) is hosting IBM D-NA workshop. &nbsp;<br><br><br>Learn skills like;&nbsp;<br>- Cloud Technology&nbsp;<br>- Data Analytics&nbsp;<br>- BlockChain&nbsp;<br><br>- Internet of Things&nbsp;<br><br>- Artificial Intelligence etc.&nbsp;<br>IBM D-NA workshop is a 3 hour workshop facilitated by Lonadek Incorporated. If you are interested in acquiring 21st century skills for employability, &nbsp;<br><br><br><br>business growth or you are just looking to expand your skills in emerging technologies, then you should apply for this opportunity.&nbsp;<br>For every course you successfully complete, an IBM Digital Badge will be issued, which you can share on social media platforms like LinkedIn. &nbsp;<br><br><br><br>More importantly, as a registered D - NA user, you are entitled to a free IBM Cloud Lite account.&nbsp;<br>Opportunities are available to register for the Morning OR Afternoon Sessions.&nbsp;<br>Date: 8th February 2019&nbsp;<br>Venue:The Cedar stem and Entrepreneurship Hub 12, Jibowu street Yaba Lagos.&nbsp;<br><br><br><br>To attend, kindly register at https://lnkd.in/d63sqtP&nbsp;<br>For enquires call 08164339275 or send an email to info@thecedarcentre.org&nbsp;<br>#Cloudtechnology #Dataanalytics #digitalskills #blockchain #WednesdayMotivation #wednesdaywisdom #wednesdaythoughts #MellowWednesday #IBMCloud&nbsp;</p>', NULL, NULL, 'show', '3.369884490966797', '6.51010916442955', 'Nigeria [NG]', 'Lagos', 'Lagos', 30985, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'Lonadekibmworkshop', NULL, '231rcfre2', 864, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
