(319, 'Investment Masterclass ', '<p>In 2020, you will be as rich as the wise decisions and actions taken around your investment.</p><p>Join Thinking School on Saturday, 25th of January, 2020 to learn how to multiply your income without breaking your back.</p><p>At this masterclass, you will be able to learn the basic principles of investing, financial indices to track daily, planning and developing your personal investment workplan and many more</p><p>Investment for the class is #5, 000 only.&nbsp;</p>', '2020-01-25', '2020-01-25', 'uploads/15784840915088968IMG_20191231_165753.jpg', '1578465486_6192162', '11:48:11', '2020-01-08', 'TRN_157848409113786', 'thumb/15784840913333069IMG_20191231_165753.jpg', 0, '10:00 AM - 02:00 PM', '2nd Floor, J and B Building, beside Old SSS Office, Basiri ', 'Thinking School Nigeria ', '<p>A social enterprise that seeks to bridge the knowledge gap for entrepreneurs through novel models.</p>', NULL, NULL, 'show', '5.237108700000022', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2020-01-26', NULL, 10, NULL, 1, 'TSmasterclass', NULL, '231rcfre2', 2307, NULL, 'free', 'single', '5000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
