(324, 'VOLUNTEERING AS A TOOL FOR SELF DEVELOPMENT', '<p>The training is focused at showcasing the importance volunteering.</p>', '2020-06-20', '2020-06-20', 'uploads/1592463479mailEnactus_Volunteerism_flier_dsg.jpg', '2402869853369649', '09:17:34', '2020-06-15', 'TRN_159221265419099', 'thumbs/1592463479mailEnactus_Volunteerism_flier_dsg.jpg', 0, '3:30', 'https://zoom.us/j/99123225806?pwd=YW9XOE8vN0svQ3BOZmttMm04emx5UT09', 'EnactusEKSU', '<p>&nbsp;</p>', NULL, NULL, 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'EnactusEKSU', NULL, '231rcfre22', 1016, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(325, 'Web Development Training', '<p>Our Web Development Program is a thoughtfully crafted curriculum designed to initiate participants into the world of Web Applications Development; irrespective of their academic background. Participants would dirty their hands by working on projects such as Internet Banking, E-commerce, Online Forums, Electronic Health Record Manager, lots more</p>', NULL, NULL, 'uploads/15928445356351106WhatsApp_Image_2020_06_16_at_7.29.38_AM.jpeg', '1592897314_3378207', '04:48:55', '2020-06-22', 'TRN_159284453584911', 'thumb/1592844535323345WhatsApp_Image_2020_06_16_at_7.29.38_AM.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', NULL, NULL, 'show', '3.343985080718994', '6.596831259820693', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecenterwebdev', '1', '231rcfre232', 2487, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(326, 'UI/UX Design Training', '<p>In this course, we first teach you how to create and style Web Pages using HTML and CSS. Thereafter, we introduce you to design concepts such as how to conduct User Research, how to illustrate design ideas using story boards &amp;process flows, translating these concepts into wireframes, mockups and prototypes that lead to intuitive user experiences; thereby&nbsp; helping you unleash your design creativity. And then, you begin to apply the knowledge obtained so far on real life projects â€“ both at an individual level and alongside a team of designers and developers.</p>', NULL, NULL, 'uploads/15928545082633069WhatsApp_Image_2020_06_16_at_7.29.39_AM.jpeg', '1592897314_3378207', '07:35:08', '2020-06-22', 'TRN_159285450825592', 'thumb/15928545081783490WhatsApp_Image_2020_06_16_at_7.29.39_AM.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', 'thecodecenterng', 'thecodecenterng', 'show', '3.3439809495819217', '6.596808610174946', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecenterux', '1', '231rcfre232', 2974, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(327, 'Frontend Development Training', '<p>Our Web Development Program is a thoughtfully crafted curriculum designed to initiate participants into the world of Web Applications Development; irrespective of their academic background. Participants would dirty their hands by working on projects such as Internet Banking, E-commerce, Online Forums, Electronic Health Record Manager, lots more</p>', NULL, NULL, 'uploads/15928550899551260WhatsApp_Image_2020_06_16_at_7.29.40_AM.jpeg', '1592897314_3378207', '07:44:49', '2020-06-22', 'TRN_159285508986098', 'thumb/15928550893358578WhatsApp_Image_2020_06_16_at_7.29.40_AM.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', 'thecodecenterng', 'thecodecenterng', 'show', '3.344002407254041', '6.596819267977229', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecenterfrontend', '1', '231rcfre232', 2545, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(328, 'Java Programming Training', '<p>The Java Programming Language being one of the worldâ€™s most widely used computer programming language, our beginner module is designed to help participants establish a solid foundation in the languageâ€™s paradigm; placing them on a good pedestal for a successful career in Software Engineering</p>', NULL, NULL, 'uploads/15928561507847047WhatsApp_Image_2020_06_16_at_7.29.39_AM__1_.jpeg', '1592897314_3378207', '08:02:30', '2020-06-22', 'TRN_159285615054154', 'thumb/15928561508752496WhatsApp_Image_2020_06_16_at_7.29.39_AM__1_.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', 'thecodecenterng', 'thecodecenterng', 'show', '3.343985080718994', '6.59681793756819', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecenterjava', '1', '231rcfre232', 2570, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(329, 'Data Science', '<p>In this course, we are going to teach you the fundamentals of database management using SQL Programming. Thereafter, we move on to Python Programming; after which we\'ll now begin to apply the knowledge of SQL Programming and Python Programming to Data Science - Data Extraction, Data Transformation, and Data Analysis &amp; Reporting.</p>', NULL, NULL, 'uploads/15928565955497527WhatsApp_Image_2020_06_16_at_7.29.40_AM__1_.jpeg', '1592897314_3378207', '08:09:55', '2020-06-22', 'TRN_159285659572842', 'thumb/15928565957404258WhatsApp_Image_2020_06_16_at_7.29.40_AM__1_.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', 'thecodecenterng', 'thecodecenterng', 'show', '3.3439916784179813', '6.596787294570114', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecenterdata', '1', '231rcfre232', 2548, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(330, 'Mobile Apps Development Training', '<p>An Android Developer is responsible for developing applications for mobile devices powered by the Android Operating System â€“ one of the most popular mobile operating systems.</p><p>Our Android Development course is a 3-month intensive program by the end of which participants would be able to tick the following boxes as success metrics&nbsp;</p><ul><li>Participants would be well grounded in the knowledge of Android SDK, its different versions and how to handle different screen sizes</li><li>Participants would possess sound knowledge of Android UI design principles and patterns</li><li>Participants can translate mobile app specification/requirements into codes</li><li>Participants would be familiar with RESTful APIs required to connect Android applications to back-end services</li></ul>', NULL, NULL, 'uploads/15928569086751679WhatsApp_Image_2020_06_16_at_7.29.40_AM__2_.jpeg', '1592897314_3378207', '08:15:08', '2020-06-22', 'TRN_159285690851975', 'thumb/15928569086090507WhatsApp_Image_2020_06_16_at_7.29.40_AM__2_.jpeg', 0, '', '35, Olowu Street, Ikeja, Lagos', 'The Code Center', '<p>We are a revolutionary Coding School on a mission to demystify Computer Science education, making it a dream career for everyone</p>', 'thecodecenterng', 'thecodecenterng', 'show', '3.3514863', '6.601838', 'Nigeria [NG]', 'Lagos', 'Ikeja', 30983, 2671, 160, NULL, NULL, NULL, NULL, NULL, NULL, 'thecodecentermobiledev', NULL, '231rcfre232', 2505, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(331, 'The Life, Leadership & Entreprenuership summit 1.0', '<p>COUNCIL OF ELDERS MEDIA &nbsp;presents a 7-days online training; LIFE, LEADERSHIP &amp; ENTREPRENEURSHIP summit v1.0</p><p><strong>Life</strong> is about the opportunities that exist.<br><strong>Leadership</strong> is in how we serve and guide others to fulfill a purpose.<br><strong>Entrepreneurship</strong> is all about the opportunities we seize to make an impact.<br><strong>Impact</strong> is what defines our existence.<br>Join the <strong>Council of Elders Media</strong> on<strong> #LLESUMMIT v1.0</strong><br>It promises to be Xplosive!</p><p><a href=\"https://tinyurl.com/LLEsummit\"><strong>Register here</strong></a><strong>.</strong><br>&nbsp;</p>', '2020-06-28', '2020-07-04', 'uploads/15929928046354835training.jpg', '1592987437rcdelro7c2etusf35elc0978oiiln9a4', '10:00:04', '2020-06-24', 'TRN_159299280433143', 'thumb/15929928044289577training.jpg', 0, '8:00pm-9:00pm ', NULL, 'Council of Elders Media', '<p><strong>Council of Elders Media </strong>is a 21st Century Social Media Marketing Agency.</p>', NULL, '@councilofE', 'show', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'LLEsummit1.0', NULL, '231rcfr32', 1613, NULL, NULL, NULL, NULL, NULL, 'WhatsApp', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(332, 'Introduction to Professional Web Programming (Virtual)', '<p>âž¡ Do you desire to learn about web development and you don\'t know how to start?<br>âž¡ Are you a novice in web development and you don\'t know how to improve yourself? This is an opportunity for you.</p><p>Mckodev Tech Lab training would entail the following ( HTML, CSS, MySql, PHP, VANILLA JS , AJAX), the training would last for 7 weeks.</p><p>Introductory class is available where you will be briefed about how it\'s going to run and get all materials and installations needed for the training.</p><p>Successful trainees may get opportunity to join Mckodev Tech Lab Where they would be mentored deeply in web development &nbsp;on Devops(GIT, NGINX,cloud computing), MVC and also gain more experience with us.</p><p>Reg Fee: #10000<br>Tuition: #30000</p><p>You can learn from anywhere you are.</p><p>Requirements: Applicants must have basic knowledge of at least &nbsp;ONE of - Microsoft Word, Microsoft PowerPoint, Microsoft Excel, CorelDraw, Adobe Photoshop or any other equivalent.</p><p>All participants must have a laptop computer as the training is 100% practicals.</p><p>REMOTE CLASS AVAILABLE FOR PARTICIPANTS FROM ANY LOCATION.</p><p><a href=\"https://api.whatsapp.com/send?phone=+23408168785591&amp;text=I will like to find out about remote participation for Mckodev training\">Click Here to Contact Mckodev for remote participation</a></p><p>No prior programming knowledge or skill is needed<br>&nbsp;</p><p><br>Don\'t Miss this opportunity<br>Contact Us on this number<br>Call: 08168785591 (Whatsapp)</p>', NULL, NULL, 'uploads/1603712180mailIMG_20201018_WA0005.jpg', 'j90819542aBn72i', '11:15:51', '2020-07-23', 'TRN_159554615119059', 'thumbs/1603712180mailIMG_20201018_WA0005.jpg', 0, '', 'Online', 'Mckodev Tech Lab', '<p>McKodev Tech Lab is a registered Web Development Agency where results â€“ quality delivery of products - that advances your cause are built with human friendly and people oriented solutions. Built on the core values of standard user friendly and dynamic website, your (business) needs superintends our need to impress. Through your exclusive work, our unique expertise gets expressed. When your business succeeds, ours does</p>', 'mckodev', 'mckodev', 'show', '5.237108699999999', '7.6124263', 'Nigeria [NG]', 'Ekiti', 'Ado', 30798, 2660, 160, 1, '2024-11-14', NULL, 200, NULL, 1, 'mckodev', NULL, '231rcfre232', 4095, NULL, 'paid', 'categorized', '10000', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
