(345, 'Mckodev Tech Lab Training -  Cohort 8 (Laspotech)', '<p>âž¡ Are you a Student of Laspotech?</p><p>âž¡&nbsp;Do you desire to learn about web development and you don\'t know how to start?</p><p>âž¡ Are you a novice in web development and you don\'t know how to improve yourself? This is an opportunity for you.</p><p>Mckodev Tech Lab training would entail the following ( HTML, CSS, MySql, PHP, VANILLA JS , AJAX), the training would last for 10 weeks.</p><p>Introductory class is available where you will be briefed about how it\'s going to run and get all materials and installations needed for the training.</p><p>Successful trainees may get opportunity to join Mckodev Tech Lab Where they would be mentored deeply in web development &nbsp;on Devops(GIT, NGINX,cloud computing), MVC and also gain more experience with us.</p><p>Reg Fee: #10,000<br>Tuition: FREE</p><p>You can learn anytime within class frame. Assignments are compulsory to be submitted in due time.&nbsp;</p><p>Requirements: Applicants must have basic knowledge of at least &nbsp;ONE of - Microsoft Word, Microsoft PowerPoint, Microsoft Excel, CorelDraw, Adobe Photoshop or any other equivalent.</p><p>All participants must have a laptop computer as the training is 100% practicals.</p><p>Remote</p><p><a href=\"https://api.whatsapp.com/send?phone=+23408168785591&amp;text=I%20will%20like%20to%20find%20out%20about%20remote%20participation%20for%20Mckodev%20training in OAU\">Click Here to Contact Mckodev Tutor</a></p><p>No prior programming knowledge or skill is needed<br>&nbsp;</p><p><br>Don\'t Miss this opportunity<br>Contact Us on this number<br>Call: 08168785591 (Whatsapp)</p>', NULL, NULL, 'uploads/1629286824mailpp.jpg', 'j90819542aBn72i', '12:19:02', '2021-01-16', 'TRN_16107995427040334899', 'thumbs/1629286824mailpp.jpg', 0, '', 'LASPOTECH', 'Mckodev Tech Lab', '<p>McKodev Tech Lab is a registered Web Development Agency where results â€“ quality delivery of products - that advances your cause are built with human friendly and people oriented solutions. Built on the core values of standard user friendly and dynamic website, your (business) needs superintends our need to impress. Through your exclusive work, our unique expertise gets expressed. When your business succeeds, ours does</p>', NULL, NULL, 'show', '4.5508168599121035', '7.491276304221263', 'Nigeria [NG]', 'Lagos', 'Ikorodu', 30984, 2671, 160, 1, '2024-12-16', NULL, 3000, NULL, 1, 'mckodev_laspotech', NULL, '231rcfre232', 1921, NULL, 'paid', 'single', '10000', '1', NULL, 'a:5:{s:8:\"TGV2ZWw=\";a:5:{s:2:\"id\";s:8:\"TGV2ZWw=\";s:8:\"question\";s:5:\"Level\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:1;}s:68:\"RG8geW91IGhhdmUgYW55IHByaW9yIGtub3dsZWRnZSBvZiBXZWIgUHJvZ3JhbW1pbmc/\";a:5:{s:2:\"id\";s:68:\"RG8geW91IGhhdmUgYW55IHByaW9yIGtub3dsZWRnZSBvZiBXZWIgUHJvZ3JhbW1pbmc/\";s:8:\"question\";s:51:\"Do you have any prior knowledge of Web Programming?\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:2:{i:0;s:3:\"Yes\";i:1;s:2:\"No\";}s:8:\"required\";b:1;}s:136:\"SWYgeW91IGhhdmUgcHJpb3Iga25vd2xlZGdlIHBsZWFzZSBzdGF0ZSB0aGUgbGFuZ3VhZ2VzIG9mIHdoaWNoIHlvdSBhcmUgcHJvZmljaWVudC4gSWYgbm90IGxlYXZlIGJsYW5r\";a:5:{s:2:\"id\";s:136:\"SWYgeW91IGhhdmUgcHJpb3Iga25vd2xlZGdlIHBsZWFzZSBzdGF0ZSB0aGUgbGFuZ3VhZ2VzIG9mIHdoaWNoIHlvdSBhcmUgcHJvZmljaWVudC4gSWYgbm90IGxlYXZlIGJsYW5r\";s:8:\"question\";s:102:\"If you have prior knowledge please state the languages of which you are proficient. If not leave blank\";s:4:\"type\";s:6:\"single\";s:7:\"options\";b:0;s:8:\"required\";b:0;}s:12:\"QWdlIFJhbmdl\";a:5:{s:2:\"id\";s:12:\"QWdlIFJhbmdl\";s:8:\"question\";s:9:\"Age Range\";s:4:\"type\";s:7:\"options\";s:7:\"options\";a:5:{i:0;s:7:\"10 - 15\";i:1;s:7:\"16 - 20\";i:2;s:7:\"21 - 25\";i:3;s:7:\"26 - 30\";i:4;s:7:\"31 - 35\";}s:8:\"required\";b:1;}s:60:\"RGF0ZSBhbmQgTW9udGggb2YgQmlydGggKFllYXIgbm90IFJlcXVpcmVkKQ==\";a:5:{s:2:\"id\";s:60:\"RGF0ZSBhbmQgTW9udGggb2YgQmlydGggKFllYXIgbm90IFJlcXVpcmVkKQ==\";s:8:\"question\";s:43:\